export default function videoReducer(state, action) {
   const data = action.payload;
   switch (action.type) {
      case "ADD_VIDEO":
         if (state) {
            const state_temp = [...state, data];
            return [...state, data];
         } else {
            return false;
         }
      //  return [...state, data];
      default:
         return;
   }
}
